const showRooms = function() {

    var row=$("table > tbody > tr.room")
    $("table > tbody > tr.room").hide().filter(function() {
        var area = parseFloat($(this).data("area"), 10);
        var id = parseInt($(this).data("id"), 10);
        var booked = $(this).data("booked");
        var activeProperties=Object.keys(propertyFilter).filter((key)=> propertyFilter[key]);
        var isInActiveProperty = activeProperties.some((key,idx)=>properties[key]['room'][`${id}`]);
        
        if(!isInActiveProperty){
          return false
        }
        
        if(bookingFilter=="All"){
          return area >= sizeFilter['min'] && area <= sizeFilter['max'] 
        }
        else if(bookingFilter=="Booked"){
          return area >= sizeFilter['min'] && area <= sizeFilter['max']  && (booked=='Booked'|| booked=='Partly')
        }
        else if(bookingFilter=="Free"){
          return area >= sizeFilter['min'] && area <= sizeFilter['max']  && (booked=='Free' || booked=='Partly')
        }
        else if(bookingFilter=="Partly"){
          return area >= sizeFilter['min'] && area <= sizeFilter['max']  && booked=='Partly'
        }

    }).show();
}
